def find_shortest_path(x,y):
    d={i:None for i in a}
    p=d.copy()
    d[x]=0
    q=deque([x])
    while q:
        v=q.popleft()
        for i in a[v]:
            if d[i] is None:
                d[i]=d[v]+1
                p[i]=v
                q.append(i)
    r=[y]
    pr=p[y]
    while not pr is None:
        r.append(pr)
        pr=p[pr]
    return r[::-1]
        

